class Bairro:
	def __init__(self, neighborhood, lat, lng, price_by_meter):
		self.neighborhood = neighborhood
		self.lat = lat
		self.lng = lng
		self.price_by_meter = price_by_meter
		self.delegacia = 0
		self.hospital = 0
		self.ubs = 0
		self.upa = 0
		self.school = 0
		self.market = 0
		self.shopping = 0
		self.university = 0

	def __repr__(self):
		# return "%s(%r)" % (self.__class__, self.__dict__)
		return "%r" % (self.__dict__)

	def format2CSVFile(self):
		return ';'.join([self.neighborhood, 
		str(self.lat), 
		str(self.lng), 
		str(self.price_by_meter), 
		str(self.delegacia), 
		str(self.hospital), 
		str(self.ubs), 
		str(self.upa), 
		str(self.school), 
		str(self.market), 
		str(self.shopping), 
		str(self.university)])

def listBairros():
	regressao = []
	l = db.health.find({'type' : 'place_consolidate'})
	for j in l:
		newBairro = Bairro(j['neighborhood'], j['lat'], j['lng'], j['price_by_meter'])
		regressao.append(newBairro)
	return regressao

def matchDelegacia(regressao):
	cIguais = 0
	l = db.health.find({'type' : 'delegacia'})
	for j in l:
		for b in regressao:
			if b.neighborhood.lower() == j['neighborhood'].lower():
				cIguais += 1
				b.delegacia += 1
	print('Delegacias encontradas:', cIguais)
	return regressao

