def csvFile(regressao, filename='regressao.csv'):
	try:
		f = open(filename, 'w')
		cabecalho = ';'.join(['neighborhood', 'lat','lng','price_by_meter','delegacia','hospital','ubs','upa','school','market','shopping','university'])
		f.write(cabecalho)
		f.write('\n')
		for i in regressao:
			# if i.delegacia > 0 or i.hospital > 0 or i.ubs > 0 or i.upa > 0 or i.school > 0 or i.market > 0 or i.shopping > 0 or i.university > 0:
			f.write(i.format2CSVFile())
			f.write('\n')
			f.flush()
		f.closed
		print('Arquivo gerado com sucesso')
	except Exception as e:
		print('Erro ao gerar arquivo')

